import React, {useState} from 'react';
import {Link} from 'react-router-dom';

function Menu() {


  return (
    <div className="homeListDiv">
        <ul className="homeList">
          <Link style={{textDecoration:"none"}} to=''><li>Adicionar Evento</li></Link>
          <Link style={{textDecoration:"none"}} to=''><li>Editar Evento</li></Link>
          <Link style={{textDecoration:"none"}} to=''><li>Remover Evento</li></Link>
          <Link style={{textDecoration:"none"}} to=''><li>Listar Eventos</li></Link>
        </ul>
    </div>

  );
}

export default Menu;
